import dataXML from "./carsData/Cars.xml"
import { useState, useEffect } from "react";

import axios from "axios";

function Xml() {
    const [dataXML, setdata] = useState({});

    const getData = async () => {
        try {
            axios.get(XMLData, {
                "Content-Type": "application/xml; charset=utf-8"
            })
                .then((response) => {
                    console.log('dataXML', response.data);
                });

            setdata(response.data[0]);
        } catch (error) {
            console.log(error);
        }
    };

    useEffect(() => {
        getData();
    }, []);

    console.log(dataXML);

    return (
        <div>
            <h1>{dataXML.effectiveDate}</h1>

            <h2>{dataXML.no}</h2>
        </div>
    );
}

export default Xml;
